INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (1, 8, 91002, 40, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", "フリーマーケット会場", "ペコリーヌとの出会い", 5118061, 10118, 20063115, 2, 0, "青空の下で謁見", 7, 2834);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (1, 8, 91002, 40, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", "フリーマーケット会場", "マホとの出会い", 5118062, 10118, 20063115, 2, 0, "未来の騎空団\nマスコット？", 7, 2835);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (1, 8, 91002, 40, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", "ランドソル市街地", "アキノとの出会い", 5118063, 10118, 20063115, 2, 0, "お嬢さまからの\n緊急依頼", 7, 2837);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (1, 8, 91002, 40, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", "フリーマーケット会場", "ジュンとの出会い", 5118064, 10118, 20063115, 2, 0, "黄金色の悩みごと", 18, 4108402);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (1, 8, 91002, 40, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", "フリーマーケット会場", "カオリとの出会い", 5118065, 10118, 20063115, 2, 0, "白熱！　格闘大会！", 18, 4107402);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (1, 8, 91002, 40, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", "オーエド町", "ニノンとの出会い", 5118066, 10118, 20063115, 2, 1, "祭り太鼓はオーエドの華", 16, 9000227);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (1, 8, 91002, 40, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", "フリーマーケット会場", "スズナとの出会い", 5118067, 10118, 20063115, 3, 0, "人気者は遅れて\nやってくる", 19, 2101181);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (1, 8, 91002, 40, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", "ランドソル市街地", "ナナカとの出会い", 5118068, 10118, 20063115, 3, 0, "巫女・ミーツ・魔法少女", 18, 4109402);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (1, 8, 91002, 40, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", "フリーマーケット会場", "キャル＆コッコロとの出会い", 5118069, 10118, 20063115, 3, 0, "ネズ耳は二度なくなる", 18, 4305402);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (1, 8, 91002, 40, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", "ランドソル市街地", "ユカリとの出会い", 5118070, 10118, 20063115, 3, 0, "この出会いにカンパイ！", 18, 4101402);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (1, 8, 91002, 40, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", "ランドソル市街地", "アオイとの出会い", 5118071, 10118, 20063115, 3, 0, "陰陽アンサンブル", 18, 4106402);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (1, 8, 91002, 40, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", "フリーマーケット会場", "シノブとの出会い", 5118072, 10118, 20063115, 3, 1, "運試し十番勝負！", 7, 2836);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (0, 0, 0, 0, 0, 0, "オープニング", 5118600, 10118, 20063115, 1, 0, "彼女たちの新たな日常", 0, 0);
